import React, { useEffect, useState } from 'react';

const Leaderboard: React.FC = () => {
  const [winners, setWinners] = useState<{ name: string; score: number }[]>([]);
  const [countdown, setCountdown] = useState('02:15:47');
  const isLoggedIn = localStorage.getItem('token') !== null;

  useEffect(() => {
    if (isLoggedIn) {
      const fetchWinners = async () => {
        const data = [
          { name: 'Alice', score: 95 },
          { name: 'Bob', score: 90 },
          { name: 'Charlie', score: 85 },
        ];
        setWinners(data);
      };

      fetchWinners();
    } else {
      // Start static countdown for display
      let seconds = 8147; // 2hr 15min 47s in total seconds
      const interval = setInterval(() => {
        if (seconds <= 0) {
          clearInterval(interval);
        } else {
          seconds--;
          const hrs = String(Math.floor(seconds / 3600)).padStart(2, '0');
          const mins = String(Math.floor((seconds % 3600) / 60)).padStart(2, '0');
          const secs = String(seconds % 60).padStart(2, '0');
          setCountdown(`${hrs}:${mins}:${secs}`);
        }
      }, 1000);
      return () => clearInterval(interval);
    }
  }, [isLoggedIn]);

  if (!isLoggedIn) {
    return (
      <div className="text-center mt-10">
        <h2 className="text-2xl font-bold text-indigo-700 mb-2">Top 3 users compete every week</h2>
        <p className="text-gray-600 mb-4">Login to participate and see the full leaderboard!</p>

        <table className="w-full max-w-md mx-auto border border-gray-300 rounded-lg mb-4">
          <thead className="bg-indigo-100 text-indigo-800">
            <tr>
              <th className="text-left p-2">Name</th>
              <th className="text-left p-2">Score</th>
            </tr>
          </thead>
          <tbody>
            <tr className="border-t border-gray-200">
              <td className="p-2">User****</td>
              <td className="p-2">95</td>
            </tr>
            <tr className="border-t border-gray-200">
              <td className="p-2">Anon****</td>
              <td className="p-2">90</td>
            </tr>
            <tr className="border-t border-gray-200">
              <td className="p-2">Guest****</td>
              <td className="p-2">85</td>
            </tr>
          </tbody>
        </table>

        <p className="text-sm text-gray-500 mb-2">Next leaderboard resets in: <span className="font-semibold text-indigo-700">{countdown}</span></p>

        <a href="/login" className="inline-block mt-2 px-6 py-2 bg-indigo-600 text-white rounded hover:bg-indigo-700">
          Login to Compete
        </a>
      </div>
    );
  }

  return (
    <div className="p-6 max-w-xl mx-auto">
      <h1 className="text-2xl font-bold text-indigo-700 mb-4">Leaderboard</h1>
      <table className="w-full border border-gray-300 rounded-lg">
        <thead className="bg-indigo-100 text-indigo-800">
          <tr>
            <th className="text-left p-2">Name</th>
            <th className="text-left p-2">Score</th>
          </tr>
        </thead>
        <tbody>
          {winners.map((winner, index) => (
            <tr key={index} className="border-t border-gray-200">
              <td className="p-2">{winner.name}</td>
              <td className="p-2">{winner.score}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Leaderboard;
